  [],\n\t\"revision_timestamp\": \"2015-12-20T18:49:21.852909\",\n\t\"name\": \"nearshore-marine-fish-assemblages-in-southern-california5d966\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fish benthic trawls were completed by the
  Southern California Coastal Water Research Project (SCCWRP). Data from 425 fisheries
  independent trawls ranging from 2-215 meters depth were collected in 1994 and 1998
  during the months of June-August. Fish that were not present in at least 5% of the
  trawls were removed from this analysis. The data set contained information for 150
  fish species, but removal of rare species resulted in 48 species. Site groups were
  calculated using the Bray-Curtis dissimilarity coefficient with average means clustering
  (Romesburg, 1991). Gear included a 7.6-m head-rope semi balloon otter trawl with
  1.25 cm codend mesh trawled for 5-10 minutes at each station. For more information
  on trawl methods, see Allen et al. (1997), and Allen et al. (2003).\",\n\t\"license_title\":
